import React, { useEffect } from 'react'
import './App.css';
import Signin from './Components/Singin/Signin';
import {Routes, Route, Navigate, BrowserRouter} from 'react-router-dom'
import Items from './Components/Items/Items';
import { useDispatch, useSelector } from 'react-redux';
import { apis } from './Apis/apis';
import { getUser } from './Slices/usersSlice';
import { getUsersData } from './helpers/getUsersData';
import { filterUsersData } from './helpers/filterUsersData';
import Error from './Components/Error/Error';
import { currentType } from './types/Types';
import { useAxios } from './Hooks/useAxios';

const App = () => {
  const dispatch = useDispatch()
  const [loading, error, data] = useAxios(apis.users)
  // TOOD: remove all any types
  // TODO: separate types
  const {current}: currentType = useSelector((state: any) => state.current)
  const currentUser = !!Object.keys(current).length

  // TODO: remove all logic to .hook.ts file
  // useEffect(() => {getUsersData(apis.users).then((response: any) => dispatch(getUser(filterUsersData(response))))}, [])
  useEffect(() => {dispatch(getUser(data))}, [])

  return (
    <BrowserRouter>
        <Routes>
          <Route path='/' Component={Signin}/>
          <Route path='/error' Component={Error}/>
          { currentUser? <Route path='/items' Component={Items}/> : <Route path='/items' element={<Navigate to='/' replace/>}/>}
          { <Route path='*' element={<Navigate to='/error' replace/>}/>}
      </Routes>
    </BrowserRouter>
  )
}

export default App
